import React, { Children } from 'react';

const Base = ({
    title = 'My title',
    Children
}) => {
    return (
        <div>
            <div className="jumbotron bg-dark text-white text-center">
                <h1 className="display-4">{title}</h1>
            </div>
            <div>{Children}</div>
        </div>
    );
}

export default Base;
